import 'dart:convert';
import 'dart:io';
import 'dart:typed_data';

import 'package:image_picker/image_picker.dart';

Future<XFile?> pickAnImageFromGallery() async {
  XFile? avatar = await ImagePicker().pickImage(
      maxWidth: 1920,
      maxHeight: 1080,
      imageQuality: 100,
      source: ImageSource.gallery);
  return avatar;
}

Future<String> convertToBase64(XFile image) async{
  final bytes = await image.readAsBytes();
  String base64String = base64Encode(bytes);
  return base64String;
}

Uint8List convertBase64ToUint8List(String image) => base64Decode(image);

Future<String> getImageAsBase64ByPath(String path) async {
  final file = File(path);
  final bytes = await file.readAsBytes();
  return base64Encode(bytes);
}

